const html = "<figure>\n  <img src=\"https://lh3.googleusercontent.com/-1ba88AyW61k/Tx8jFMtzRNI/AAAAAAAABak/2hvXaH-hx7Y/s400/Carter%252527s%252520WP7_000147.jpg\" alt=\"Twilio offices at night\" height=\"300\" width=\"400\">\n  <figcaption>Twilio offices at night</figcaption>\n</figure>\n<p>I am back in Seattle, writing this blog post from <a href=\"http://www.agnesunderground.com/\">Agnes Underground</a>, a new co-working spot in Capitol Hill. This is the 2nd co-working space I’ve checked-out (<a href=\"http://officenomads.com/\">Office Nomads</a> being the 1st) and I’m finding this process super valuable and quite fun. Meeting lots of interesting people.</p>\n<p>But I’m getting ahead of myself. Last week was <em>amazing</em>! I flew down to San Francisco on Tuesday morning to start my new job at Twilio. My plane landed at 9:33am and I actually thought I’d make it into the office by ~10am. Whoops. Huffing and puffing, I burst into the office just after 10:45am to find it… completely empty. I knew there was an all-hands company meeting going on, but it’s definitely wasn’t happened on the 3rd floor of 501 Folsom St.</p>\n<p>After some comical escapades that involved getting locked into stairwells and “visiting” Twilio’s other neighbors in the building, I finally was routed to our new office space on the 1st floor, where I caught the tail-end of the all-hands. Just in time for Jeff to pull me in front of the company and force everyone to chant my name until it was tatooed on their cerebral cortex.</p>\n<figure>\n  <img src=\"https://lh6.googleusercontent.com/-U9JmDkhd6wU/Tx8jBHdOpeI/AAAAAAAABa4/aYAFu4Ft3kY/s400/Carter%252527s%252520WP7_000128.jpg\" alt=\"White House CTO - Aneesh Chopra\" height=\"300\" width=\"400\">\n  <figcaption>White House CTO - Aneesh Chopra</figcaption>\n</figure>\n<p>The rest of the week was pretty typical, I hear: the <a href=\"https://twitter.com/aneeshchopra\">White House CTO</a> dropped-in on Tuesday. Catered dinner of fried chicken and waffles on Wednesday. Epic Holiday party and karaoke bash on Thursday. I don’t think there are many companies where I would feel totally comfortable belting-out “Paraside City” on my 3rd day, but Twilio is one of them.</p>\n<figure>\n  <img src=\"https://lh5.googleusercontent.com/-84CW1HQKQBs/Tx8jF3FKfzI/AAAAAAAABa0/D77NFn8vuA0/s400/Carter%252527s%252520WP7_000149.jpg\" alt=\"I&#x27;m a DOER\" height=\"300\" width=\"400\">\n  <figcaption>Are you a DOER?</figcaption>\n</figure>\n<p>So now I find myself back home in Seattle.  As much as I love San Francisco, Seattle definitely feels like home.  I’m still getting to know the startup community here, but there is no shortage of <a href=\"http://www.meetup.com/HackerNewsSeattleMeetup/\">meetups</a> or <a href=\"http://www.seattletechcalendar.com/\">events</a> to keep you busy.  I’m feeling a lot of energy up here, especially regarding the shift to the cloud and the curiosity around Windows 8.  Exciting times to DO something!</p>";

